import React from 'react';
import { AppBar, Toolbar, IconButton, Typography, Button } from '@mui/material';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import BusinessCenterIcon from '@mui/icons-material/BusinessCenter';
import { styled } from '@mui/material/styles';

const CustomAppBar = styled(AppBar)(({ theme }) => ({
  backgroundColor: '#932F6D',
}));

const Title = styled('div')(({ theme }) => ({
  flexGrow: 1,
  display: 'flex',
  alignItems: 'center',
}));

const Logo = styled('img')(({ theme }) => ({
  marginRight: theme.spacing(2),
}));

const Buttons = styled('div')(({ theme }) => ({
  display: 'flex',
  alignItems: 'center',
}));

const StyledButton = styled(Button)(({ theme }) => ({
  marginLeft: theme.spacing(2),
  color: '#fff',
}));

export default function Header() {
  return (
    <CustomAppBar position="static">
      <Toolbar>
        <Title>
          <Logo src="/path-to-logo.png" alt="Mi Tiara Logo" />
          <Typography variant="h6">Mi Tiara</Typography>
        </Title>
        <Buttons>
          <IconButton edge="start" sx={{ color: '#fff' }} aria-label="school">
            <AccountCircleIcon />
            <Typography variant="body1">School</Typography>
          </IconButton>
          <IconButton edge="end" sx={{ color: '#fff' }} aria-label="login-signup">
            <Typography variant="body1">Login / Sign Up</Typography>
          </IconButton>
          <StyledButton startIcon={<BusinessCenterIcon />}>
            List Business
          </StyledButton>
        </Buttons>
      </Toolbar>
    </CustomAppBar>
  );
}
